css:
.git-control {
  color: #adaaa4;
  background: #363430;
}
.git-control pre {
  padding: 0;
  font-size: 11px;
  color: inherit;
  background: inherit;
}
.git-control .invisible {
  display: none;
}
.git-control .clickable {
  cursor: pointer;
}
.git-control input[type='checkbox'] {
  width: auto;
  margin-right: 5px;
  vertical-align: top;
}
